// Contact.js
import React from 'react';
import '../styles/contact.css';

function Contact() {
  return (
    <div className="contact-container">
      <h2 className="contact-title">Контакты</h2>
      <p className="contact-content">Свяжитесь с нами, чтобы узнать больше о наших продуктах и услугах. Мы всегда рады новым партнерам и клиентам!</p>
    </div>
  );
}

export default Contact;
